note_models.css:
.card {
  font-family: helvetica;
  font-size: 20px;
  text-align: center;
  color: black;
  background-color: white;
}


#bottom-left {
  text-align:left;
  position: fixed;
  bottom: 20px;
  left: 20px;
  width: 33vw;
}

#bottom-right {
  position: fixed;
  bottom: 20px;
  right: 20px;
  width: 33vw;
  text-align:right;
}

#bottom-center {
  position: fixed;
  left: 50%;
  bottom: 20px;
  transform: translate(-50%,0);
  margin: 0 auto;
  width:33vw;
}
